import React from 'react'

const Layout = (props) => {
    const { state } = this.props.location.state;
    const { firstName } = state;
    return (
        <div>
            <h2>Form submit successfully </h2>

            <h2>First Name  </h2>
        </div>
    )
}


export default Layout;
